import { useForm, SubmitHandler } from 'react-hook-form';
import CreateUserCard from '../CreateUserCard';

interface DashboardProps {
  logout: any;
}

type Inputs = {
  email: string;
  firstName: string;
  lastName: string;
  gender: string;
  status: string;
};

const Dashboard: React.FunctionComponent<DashboardProps> = ({ logout }) => {
  const [view, setView] = useState('');

  const {
    register,
    handleSubmit,
    watch,
    formState: { errors }
  } = useForm<Inputs>();

  const onSubmit = (e: any) => {};

  return (
    <div>
      <Stack>
        <Button onClick={(e) => setView('create')} variant="text">
          Create User
        </Button>
        <Button onClick={(e) => setView('update')} variant="contained">
          View User
        </Button>
      </Stack>
      {view === 'create' ? <CreateUserCard /> : ''}
      {view === 'update' ? <UpdateUserCard /> : ''}
    </div>
  );
};

export default Dashboard;
